mapper.select:
select

from qb_sj_rgmb


    and cgqbh = #{cgqbh,jdbcType=VARCHAR}


    (ptbh = #{ptbh,jdbcType=VARCHAR} or
    and ptmc = #{ptbh,jdbcType=VARCHAR})


    and ptlx = #{ptlx,jdbcType=INTEGER}


    jmbz=#{jmbz,jdbcType=INTEGER}


    jjm=#{jjm,jdbcType=VARCHAR}


    jxh=#{jxh,jdbcType=VARCHAR}


    sbsj >=  #{sbsjStartTime,jdbcType=TIMESTAMP}


    #{sbsjEndTime,jdbcType=TIMESTAMP} >= sbsj

select jd,wd
from qb_sj_rgmb


    and cgqbh = #{cgqbh,jdbcType=VARCHAR}


    (ptbh = #{ptbh,jdbcType=VARCHAR} or
    and ptmc = #{ptbh,jdbcType=VARCHAR})


    and ptlx = #{ptlx,jdbcType=INTEGER}


    jmbz=#{jmbz,jdbcType=INTEGER}


    jjm=#{jjm,jdbcType=VARCHAR}


    jxh=#{jxh,jdbcType=VARCHAR}


    sbsj >=  #{sbsjStartTime,jdbcType=TIMESTAMP}


    #{sbsjEndTime,jdbcType=TIMESTAMP} >= sbsj

select

from qb_sj_rgmb


    jmbz=#{jmbz,jdbcType=INTEGER}


    jjm=#{jjm,jdbcType=VARCHAR}


    jxh=#{jxh,jdbcType=VARCHAR}


    sbsj >=  #{sbsjStartTime,jdbcType=TIMESTAMP}


    #{sbsjEndTime,jdbcType=TIMESTAMP} >= sbsj


    cgqbh = #{cgqbh,jdbcType=VARCHAR}


    (ptbh = #{ptbh,jdbcType=VARCHAR} or
    ptmc = #{ptbh,jdbcType=VARCHAR})


    ptlx = #{ptlx,jdbcType=INTEGER}


    AND JD  >=  #{startLongitude,jdbcType=DECIMAL}


    AND JD  <=  #{endLongitude,jdbcType=DECIMAL}


    AND WD  >=  #{startLatitude,jdbcType=DECIMAL}


    AND WD  <=  #{endLatitude,jdbcType=DECIMAL}
